import './App.css';
import Modal from './components/Modal/Modal';
import SelectBox from './components/Select/Select';

function App() {
  const OPTIONS = [
    { value: "apple", name: "사과" },
    { value: "banana", name: "바나나" },
    { value: "orange", name: "오렌지" },
  ];
  return (
    <div>
      <SelectBox options={OPTIONS} defaultValue="banana"/>
      <Modal/>
    </div>
  );
}

export default App;
